    return(
        <div>
        <div style={{justifyContent:'flex-start',textAlign:'left',marginLeft:'40px',marginTop:'30px'}}>
            <img  alt="Logo" style={{height:'90px', width:'15%'}} />
        </div>
        <Form/>
        </div>
    )
}

export default Header;
